import React from 'react';
import '../../styles/App.css';
import Footer from '../Footer';

function Home() {
  return (
    <>
      <div>
      <h1 style="height: 50px;" className='Profile'>Profil</h1>
      </div>
      <Footer />
    </>
  );
}

export default Home;
